import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {

    return (
        <div>
            <nav>
                <h3>Logo</h3>
                <ul className='nav-links'>
                    <a href="/shift">Shift</a>
                    <a href="/shift">Vigenere</a>
                    <a href="/shift">Affine</a>
                </ul>
            </nav>
        </div>
    );
}

export default Nav;
